// will not trigger new logs because the computed value stays \`true\`
count.value = 2
count.value = 4

//  isEven Vue 
const computedObj = computed(() => {
  return {
    isEven: count.value % 2 === 0
  }
})
// 
const computedObj = computed((oldValue) => {
  const newValue = {
    isEven: count.value % 2 === 0
  }
  if (oldValue && oldValue.isEven === newValue.isEven) {
    return oldValue
  }
  return newValue
})
